import { createRouter, createWebHistory } from "vue-router";
import HomePage from "@/views/home/HomePage.vue";
import UserPage from "@/views/home/user/UserPage.vue";
import LoginPage from "@/views/login/LoginPage.vue";

const routes = [
  {
    path: "/",
    name: "home",
    meta: { requiresAuth: false },
    redirect: { name: "newfeeds" }, // Redirect to "newfeeds" route
    component: HomePage,
    children: [
      {
        path: "home",
        name: "newfeeds",
        component: HomePage,
      },
      {
        path: ":id",
        name: "home-user",
        component: UserPage,
      },
      {
        path: "setting",
        name: "setting",
        component: HomePage, // Placeholder component, replace it with the actual component
        children: [
          {
            path: "profile",
            name: "profile",
            component: HomePage, // Placeholder component, replace it with the actual component
          },
        ],
      },
    ],
  },
  {
    path: "/auth",
    name: "auth",
    children: [
      {
        path: "/",
        name: "login",
        component: LoginPage,
      },
    ],
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
